      MagicBlood(BrickColor.new("Dark indigo"), Shooter.CFrame * euler(math.random(-50, 50), math.random(-50, 50), math.random(-50, 50)), 0.1, 0.1, 0.1, 0.1, 2, 0.1, 0.05)
