      damagebonus = 1
      hideanim()
      swait(0)
      RW.Parent = nil
      LW.Parent = nil
      RSH.Parent = player.Character.Torso
      LSH.Parent = player.Character.Torso
	  attack = false
    end
  end
  if equipped == false then
    return 
  end
  if Mode == "Binary" then
    if key == "q" then
      idle = 500
    end
    if key == "z" and hitfloor ~= nil then
      BinarySwing()
    end
    if key == "x" then
      BinaryImpulse()
    end
    if key == "c" then
      Bash()
    end
    if key == "v" then
      damagebonus = 50
      UnleashTheDemon()
    end
  end
  if Mode == "Demon" then
    if key == "z" and not Firing then
      if not DCOn then
        DemonCannon()
        DCOn = true
      else
        HideDemonCannon()
        DCOn = false
      end
    end
    if key == "x" then
      LetItBuild()
    end
    if key == "c" then
      YourMoveCreep()
    end
    if key == "b" then
      TCtrl = not TCtrl
      if TCtrl then
        TimeControl()
      end
    end
  end
  if key == "0" then
    Humanoid.WalkSpeed = 256
  end
end

